import React from "react";
import { useParams } from "react-router-dom";
import { useSelector } from "react-redux";
import CardComponentShop from "../smallComponent/CardComponentShop";
import Checkingform from "../smallComponent/CheckingForm";
import {
  Box,
  Card,
  CardActions,
  Link,
  CardContent,
  CardMedia,
  Button,
  Typography,
} from "@mui/material";

const Dish = () => {
  const url = useParams().slug;
  const allData = useSelector((state) => state);
  let data = [];
  Object.keys(allData).map((key) => {
    if (key == url) data = Object.entries(allData[key]);
  });
  const nameDish = data[1][0];
  const data1 = data[1][1];
  console.log(nameDish);

  return (
    <Box>
      <Typography
        gutterBottom
        variant="h6"
        component="div"
        className=""
        style={{ paddingLeft: "3vw",paddingTop: "1vw", outline: "none"}}
      >
        / <Link href="/shop">Shop</Link> / {nameDish}
      </Typography>
      <Box className="AllProductShop">
        {data1.map((e) => (
          <CardComponentShop data={e} />
        ))}
        <Checkingform />
      </Box>
    </Box>
  );
};

export default Dish;
